CREATE TABLE TAIKHOAN (
	MATK INT AUTO_INCREMENT,
	EMAIL VARCHAR(100) UNIQUE,
    MATKHAU VARCHAR(50) NOT NULL,
    MAXACTHUC VARCHAR(4),
    VAITRO VARCHAR(30),
    PRIMARY KEY(MATK)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE NHANVIEN(
	MANV INT,
    TEN VARCHAR(50),
    SDT VARCHAR(10),
    DIACHI VARCHAR(255),
    CHUCVU VARCHAR(50),
    LUONGTHEONGAY FLOAT,
    GIOITINH BIT,
    PRIMARY KEY(MANV)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE CHAMCONG(
	MANV INT,
    THOIGIAN DATETIME
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE KHACHHANG(
	MAKH INT AUTO_INCREMENT,
    TEN VARCHAR(50),
    SDT VARCHAR(10),
    TICHDIEM INT,
    PRIMARY KEY(MAKH)
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE LOAISANPHAM(
	MALOAI INT AUTO_INCREMENT,
    TENLOAI VARCHAR(50),
    PRIMARY KEY (MALOAI)
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE SANPHAM(
	MASP INT AUTO_INCREMENT,
    MALOAI INT,
    TEN VARCHAR(100),
    GIA FLOAT,
    DONVITINH VARCHAR(20),
    ANH VARCHAR(100),
    DELETED BIT,
    PRIMARY KEY(MASP)
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE DONHANG(
	MADH INT AUTO_INCREMENT,
	MANV INT,
    MAKH INT,
    MAVOUCHER VARCHAR(10),
    GIAMGIA INT,
    DIEM INT,
    THANHTOAN FLOAT,
    NGAYTAO DATETIME,
    PRIMARY KEY(MADH, MAKH)
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE DONHANG_SANPHAM(
	MADH INT, 
    MASP INT,
    SOLUONG INT,
    GIA FLOAT,
    PRIMARY KEY(MADH, MASP)
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE VOUCHER(
	MAVOUCHER VARCHAR(20),
    TILE INT,
    NGAYBATDAU DATE,
    NGAYKETTHUC DATE,
    SOLUONG INT,
    PRIMARY KEY(MAVOUCHER)
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


